import React from 'react';

const ListadoCanciones = ({ canciones }) => {
    return (
        <div>
            <h2>Lista de Canciones</h2>
            <ul>
                {canciones.map((cancion, index) => (
                    <li key={index}>
                        <strong>{cancion.titulo}</strong> - {cancion.artista}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ListadoCanciones;
